import React from 'react';
import Card from './Card';


function CardList(props) {
  //props.robots
  const cards = props.robots;
  const cardList = cards.map(card => {
  	return(
  	  <Card card={card} />
  	)

  })

  return (
    <div className="card-list">
  	  {cardList}
    </div>
  );
}

export default CardList;
